import React from "react";
import clsx from "clsx";
// import "./dashboard.css";
import { makeStyles } from "@material-ui/core/styles";
import Drawer from "@material-ui/core/Drawer";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import List from "@material-ui/core/List";
import icon from "../Assets/keepIcon.png"
import CssBaseline from "@material-ui/core/CssBaseline";
import IconButton from "@material-ui/core/IconButton";
import MenuIcon from "@material-ui/icons/Menu";
import Menu from "@material-ui/core/Menu";
import Paper from "@material-ui/core/Paper";
import MenuItem from "@material-ui/core/MenuItem";
import SearchIcon from "@material-ui/icons/Search";
import SettingsSharpIcon from "@material-ui/icons/SettingsOutlined";
import DnsRoundedIcon from "@material-ui/icons/DnsRounded";
import ReplayOutlinedIcon from "@material-ui/icons/ReplayOutlined";
import InputBase from "@material-ui/core/InputBase";
import ListItem from "@material-ui/core/ListItem";
import AppsRoundedIcon from "@material-ui/icons/AppsRounded";
import ListItemIcon from "@material-ui/core/ListItemIcon";
import ListItemText from "@material-ui/core/ListItemText";
import AccountCircleOutlinedIcon from '@material-ui/icons/AccountCircle';

const useStyles = makeStyles((theme) => ({
    root: {
        display: "flex",
    },
    appBar: {
        backgroundColor: "#ffff",
        borderBottom: "lightgray solid 1px",
        boxShadow: "none",
    },
    topBar: {
        backgroundColor: "#ffff",
        display: "flex",
        justifyContent: "space-between",
    },
    hide: {
        display: "none",
    },
    iconLogo: {
        width: "1.1em",
        height: "1.1em",
        [theme.breakpoints.down("xs")]: {
            width: "0.9em",
            height: "0.9em",
        },
    },
    appBarButton: {
        [theme.breakpoints.down("xs")]: {
            padding: "8px 8px 8px 8px"
        },
    },
    drawer: {
        top: "70px",
        whiteSpace: "nowrap",
    },
    drawerOpen: {
        width: "230px",
        borderRight: "lightgray solid 1px",
        transition: theme.transitions.create("width", {
            easing: theme.transitions.easing.sharp,
            duration: theme.transitions.duration.enteringScreen,
        }),
        [theme.breakpoints.down("xs")]: {
            width: "180px",
        },
    },
    drawerClose: {
        transition: theme.transitions.create("width", {
            easing: theme.transitions.easing.sharp,
            duration: theme.transitions.duration.leavingScreen,
        }),
        overflowX: "hidden",
        borderRight: "none",
        width: theme.spacing(7) + 1,
        [theme.breakpoints.up("sm")]: {
            width: theme.spacing(8) + 1,
        },
    },
    drawerButton: {
        borderTopRightRadius: "500px",
        borderBottomRightRadius: "100px",
    },
    profileIcon: {
        marginTop: "20px",
        border: "1px solid lightgray",
        borderRadius: "5px"
    },
    settingMenu: {
        marginTop: theme.spacing(4),
    },

    main: {
        marginTop: "80px",
        marginLeft: "100px",
        zIndex: "-1",
        minHeight: "100vh",
    },
    content: {
        width: "95%",
        display: "flex",
        alignItems: "flex-start",
        justifyContent: "flex-end",
        padding: theme.spacing(0, 1),
        ...theme.mixins.toolbar,
    },
    searchInput: {
        marginLeft: "10px",
        width: "80%"
    }
}));

export default function Dashboard(props) {
    const classes = useStyles();
    const [open, setOpen] = React.useState(false);


    const drawerOpen = () => {
        setOpen(true);
    };
    const drawerClose = () => {
        setOpen(false);
    };

    const drawerOpenClose = () => {
        setOpen(!open);
    };


    return (
        <div className="root" className={classes.root} >
            <CssBaseline />
            <AppBar position="fixed" position="fixed" className={classes.appBar}>
                <Toolbar className={classes.topBar}>
                    <span className="leftOptions">
                        < div className="startOptions">
                            <div className="menuButton">
                                <IconButton className={classes.appBarButton} onClick={drawerOpenClose} edge="start">
                                    <MenuIcon className={classes.iconLogo} />
                                </IconButton>
                            </div>
                            <div>
                                <img className="headerIcon" src={icon} />
                            </div>
                            <div className="headerTitle">Fundoo</div>
                        </div>
                        </span>
                        </Toolbar>
                        </AppBar>


                        <h1>DashBoard</h1>
          </div>


  );
}
